import React, { Component } from 'react';
import { Button } from 'react-bootstrap';
import { useAuth } from '../commons/auth-context/auth';
export default class SimpleFeed extends Component {
    constructor(props) {
        super(props);
        this.state = {};
        this.auth = useAuth();
    }
    render() {
        return (
            <>
                <h1> Welcome to PhotoShare </h1>
                <Button onClick={() => this.auth.signout()}>Logout</Button>
            </>
        );
    }
}
